    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 185",     marginale1: "Geiselnahme",     marginale2: "",     absatz0: "1. Wer jemanden der Freiheit beraubt, entführt oder sich seiner sonst wie bemächtigt, um einen Dritten zu einer Handlung, Unterlassung oder Duldung zu nötigen,\n\nwer die von einem anderen auf diese Weise geschaffene Lage ausnützt, um einen Dritten zu nötigen,\n\nwird mit Freiheitsstrafe nicht unter einem Jahr bestraft.\n\n2. Die Strafe ist Freiheitsstrafe nicht unter drei Jahren, wenn der Täter droht, das Opfer zu töten, körperlich schwer zu verletzen oder grausam zu behandeln.\n\n3. In besonders schweren Fällen, namentlich wenn die Tat viele Menschen betrifft, kann der Täter mit lebenslänglicher Freiheitsstrafe bestraft werden.\n\n4. Tritt der Täter von der Nötigung zurück und lässt er das Opfer frei, so kann er milder bestraft werden (Art. 48a).\n\n5. Strafbar ist auch, wer die Tat im Ausland begeht, wenn er in der Schweiz verhaftet und nicht ausgeliefert wird. Artikel 7 Absätze 4 und 5 sind anwendbar.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1lit