iteziffer2z: "",     absatz1liteziffer2: "",     marginaleabsatz1litf: "",     absatz1litfz: "",     absatz1litf: "",     absatz1litfbisz: "",     absatz1litfbis: "",     marginaleabsatz1litg: "",     absatz1litgz: "",     absatz1litg: "",     marginaleabsatz1lith: "",     absatz1lithz: "",     absatz1lith: "",     marginaleabsatz1liti: "",     absatz1litiz: "",     absatz1liti: "",     marginaleabsatz1litj: "",     absatz1litjz: "",     absatz1litj: "",     absatz1litkz: "",     absatz1litk: "",     absatz1litlz: "",     absatz1litl: "",     absatz1litmz: "",     absatz1litm: "",     absatz1litnz: "",     absatz1litn: "",     absatz1litoz: "",     absatz1lito: "",     absatz1bisz: "",     absatz1bis: "",     absatz1bislitaz: "",     absatz1bislita: "",     absatz1bislitbz: "",     absatz1bislitb: "",     absatz1bislitcz: "",     absatz1bislitc: "",     absatz2z: "2",     absatz2: "    Wer Gegenstände oder Vorführungen im Sinne von Absatz 1 öffentlich ausstellt oder zeigt oder sie sonst jemandem unaufgefordert anbietet, wird mit Busse bestraft. Wer die Besucher von Ausstellungen oder Vorführungen in geschlossenen Räumen im Voraus auf deren pornografischen Charakter hinweist, bleibt straflos.",     absatz2litaz: "",     absatz2lita: "",     absatz2litabisz: "",     absatz2litabis: "",     absatz2litbz: "",     absatz2litb: "",     absatz2litbbisz: "",     absatz2litbbis: "",     absatz2litcz: "",     absatz2litc: "",     absatz2litdz: "",     absatz2litd: "",     absatz2litez: "",     absatz2lite: "",     absatz2litfz: "",     absatz2litf: "",     absatz2litgz: "",     absatz2litg: "",     absatz2lithz: "",     absatz2lith: "",     absatz2litiz: "",     absatz2liti: "",     absatz2litjz: "",     absatz2litj: "",     absatz2litkz: "",     absatz2litk: "",     absatz2litlz: "",     absatz2litl: "",     absatz2litmz: "",     absatz2litm: "",     absatz2litnz: "",     absatz2litn: "",     absatz2litoz: "",     absatz2lito: "",     absatz2litpz: "",     absatz2litp: "",     absatz2litqz: "",     absatz2litq: "",     absatz2litrz: "",     absatz2litr: "",     absatz2litsz: "",     absatz2lits: "",     absatz2littz: "",     absatz2litt: "",     absatz2lituz: "",     absatz2litu: "",     absatz2litvz: "",     absatz2litv: "",     absatz2bisz: "",     absatz2bis: "",     absatz2bislitaz: "",     absatz2bislita: "",     absatz2bislitbz: "",     absatz2bislitb: "",     absatz2bislitcz: "",     absatz2bislitc: "",     absatz2bislitdz: "",     absatz2bislitd: "",     absatz2bislitez: "",     absatz2bislite: "",     absatz2terz: "",     absatz2ter: "",     absatz2quaterz: "",     absatz2quater: "",     absatz2quaterlitaz: "",     absatz2quaterlita: "",     absatz2quaterlitbz: "",     absatz2quaterlitb: "",     absatz2quaterlitcz: "",     absatz2quaterlitc: "",     absatz2quinquiesz: "",     absatz2quinquies: "",     absatz2sexiesz: "",     absatz2sexies: "",     absatz2septiesz: "",     absatz2septies: "",     absatz3z: "3",     absatz3: "    Wer eine minderjährige Person anwirbt, damit diese an einer pornografischen Vorführung mitwirkt, oder wer sie zur Mitwirkung an einer derartigen Vorführung veranlasst, wird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.",     absatz3litaz: "",     absatz3lita: "",     absatz3litbz: "",     absatz3litb: "",     absatz3litcz: "",     absatz3litc: "",     absatz3litdz: "",     absatz3litd: "",     absatz3litdziffer1z: "",     absatz3litdziffer1: "",     absatz3litdziffer2z: "",     absatz3litdziffer2: "",     absatz3bisz: "",     absatz3bis: "",     absatz4z: "4",     absatz4: "    Wer Gegenstände oder Vorführungen im Sinne von Absatz 1, die sexuelle Handlungen mit Tieren oder mit Gewalttätigkeiten unter Erwachsenen oder nicht tatsächliche sexuelle Handlungen mit Minderjährigen zum Inhalt haben, herstellt, einführt, lagert, in Verkehr bringt, anpreist, ausstellt, anbietet, zeigt, überlässt, zugänglich macht, erwirbt, sich über elektronische Mittel oder sonst wie beschafft oder besitzt, wird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft. Haben die Gegenstände oder Vorführungen tatsächliche sexuelle Handlungen mit Minderjährigen zum Inhalt, so ist die Strafe Freiheitsstrafe bis zu fünf Jahren oder Geldstrafe.",     absatz4litaz: "",     absatz4lita: "",     absatz4litaziffer1z: "",     absatz4litaziffer1: "",     absatz4litaziffer2z: "",     absatz4litaziffer2: "",     absatz4litbz: "",     absatz4litb: "",     absatz4litbziffer1z: "",     absatz4litbziffer1: "",     absatz4litbziffer2z: "",     absatz4litbziffer2: "",     absatz4litcz: "",     absatz4litc: "",     absatz4litdz: "",     absatz4litd: "",     absatz4bisz: "",     absatz4bis: "",     absatz4bislitaz: "",     absatz4bislita: "",     absatz4bislitbz: "",     absatz4bislitb: "",     absatz4terz: "",     absatz4ter: "",     absatz4quaterz: "",     absatz4quater: "",     absatz4quinquiesz: "",     absatz4quinquies: "",     absatz5z: "5",     absatz5: "    Wer Gegenstände oder Vorführungen im Sinne von Absatz 1, die sexuelle Handlungen mit Tieren oder mit Gewalttätigkeiten unter Erwachsenen oder nicht tatsächliche sexuelle Handlungen mit Minderjährigen zum Inhalt haben, konsumiert oder zum eigenen Konsum herstellt, einführt, lagert, erwirbt, sich über elektronische Mittel oder sonst wie beschafft oder besitzt, wird mit Freiheitsstrafe bis zu einem Jahr oder Geldstrafe bestraft. Haben die Gegenstände oder Vorführungen tatsächliche sexuelle Handlungen mit Minderjährigen zum Inhalt, so ist die Strafe Freiheitsstrafe bis zu drei Jahren oder Geldstrafe.",     absatz5litaz: "",     absatz5lita: "",     absatz5litaziffer1z: "",     absatz5litaziffer1: "",     absatz5litaziffer2z: "",     absatz5litaziffer2: "",     absatz5litaziffer3z: "",     absatz5litaziffer3: "",     absatz5litaziffer4z: "",     absatz5litaziffer4: "",     absatz5litaziffer5z: "",     absatz5litaziffer5: "",     absatz5litaziffer6z: "",     absatz5litaziffer6: "",     absatz5litaziffer7z: "",     absatz5litaziffer7: "",     absatz5litaziffer8z: "",     absatz5litaziffer8: "",     absatz5litaziffer9z: "",     absatz5litaziffer9: "",     absatz5litbz: "",     absatz5litb: "",     absatz5litcz: "",     absatz5litc: "",     absatz5litdz: "",     absatz5litd: "",     absatz5bisz: "",     absatz5bis: "",     absatz6z: "6",     absatz6: "    Bei Straftaten nach den Absätzen 4 und 5 werden die Gegenstände eingezogen.",     absatz6litaz: "",     absatz6lita: "",     absatz6litbz: "",     absatz6litb: "",     absatz6litcz: "",     absatz6litc: "",     absatz6litdz: "",     absatz6litd: "",     absatz6litez: "",     absatz6lite: "",     absatz6litfz: "",     absatz6litf: "",     absatz6litgz: "",     absatz6litg: "",     absatz6lithz: "",     absatz6lith: "",     absatz6bisz: "",     absatz6bis: "",     absatz7z: "7",     absatz7: "    Handelt der Täter mit Bereicherungsabsicht, so ist mit Freiheitsstrafe eine Geldstrafe zu verbinden.",     absatz7bisz: "",     absatz7bis: "",     absatz8z: "8",     absatz8: "    Minderjährige von mehr als 16 Jahren bleiben straflos, wenn sie voneinander einvernehmlich Gegenstände oder Vorführungen im Sinne von Absatz 1 herstellen, diese besitzen oder konsumieren.",     absatz9z: "9",     absatz9: "    Gegenstände oder Vorführungen im Sinne der Absätze 1-5 sind nicht pornografisch, wenn sie einen schutzwürdigen kulturellen oder wissenschaftlichen Wert haben."),
