    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 243",     marginale1: "Nachmachen von Banknoten, Münzen oder amtlichen Wertzeichen ohne Fälschungsabsicht",     marginale2: "",     absatz0: "",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "1",     absatz1: "    Wer ohne Fälschungsabsicht Banknoten so wiedergibt oder nachahmt, dass die Gefahr einer Verwechslung durch Personen oder Geräte mit echten Noten geschaffen wird, insbesondere wenn die Gesamtheit, eine Seite oder der grösste Teil einer Seite einer Banknote auf einem Material und in einer Grösse, die mit Material und Grösse des Originals übereinstimmen oder ihnen nahe kommen, wiedergegeben oder nachgeahmt wird,\n\nwer ohne Fälschungsabsicht Gegenstände herstellt, die den in Kurs stehenden Münzen in Gepräge, Gewicht oder Grösse ähnlich sind oder die Nennwerte oder andere Merkmale einer amtlichen Prägung aufweisen, so dass die Gefahr einer Verwechslung durch Personen oder Geräte mit in Kurs stehenden Münzen geschaffen wird,\n\nwer ohne Fälschungsabsicht amtliche Wertzeichen so wiedergibt oder nachahmt, dass die Gefahr einer Verwechslung mit echten Wertzeichen geschaffen wird,\n\nwer solche Gegenstände einführt, anbietet oder in Umlauf setzt,\n\nwird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",