    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 245",     marginale1: "Fälschung amtlicher Wertzeichen",     marginale2: "",     absatz0: "1. Wer amtliche Wertzeichen, namentlich Postmarken, Stempel- oder Gebührenmarken, fälscht oder verfälscht, um sie als echt oder unverfälscht zu verwenden,\n\nwer entwerteten amtlichen Wertzeichen den Schein gültiger gibt, um sie als solche zu verwenden,\n\nwird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.\n\nDer Täter ist auch strafbar, wenn er die Tat im Ausland begangen hat, in der Schweiz betreten und nicht ausgeliefert wird, und wenn die Tat auch am Begehungsorte strafbar ist.\n\n2. Wer falsche, verfälschte oder entwertete amtliche Wertzeichen als echt, unverfälscht oder gültig verwendet, wird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "",     absatz1litb: "",     absatz1litbziffer1z: "",     absatz1litbziffer1: "",     absatz1litbziffer2z: "",     absatz1litbziffer2: "",     absatz1l