    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 261bis",     marginale1: "Diskriminierung und Aufruf zu Hass",     marginale2: "",     absatz0: "Wer öffentlich gegen eine Person oder eine Gruppe von Personen wegen ihrer Rasse, Ethnie, Religion oder sexuellen Orientierung zu Hass oder zu Diskriminierung aufruft,\n\nwer öffentlich Ideologien verbreitet, die auf die systematische Herabsetzung oder Verleumdung dieser Personen oder Personengruppen gerichtet sind,\n\nwer mit dem gleichen Ziel Propagandaaktionen organisiert, fördert oder daran teilnimmt,\n\nwer öffentlich durch Wort, Schrift, Bild, Gebärden, Tätlichkeiten oder in anderer Weise eine Person oder eine Gruppe von Personen wegen ihrer Rasse, Ethnie, Religion oder sexuellen Orientierung in einer gegen die Menschenwürde verstossenden Weise herabsetzt oder diskriminiert oder aus einem dieser Gründe Völkermord oder andere Verbrechen gegen die Menschlichkeit leugnet, gröblich verharmlost oder zu rechtfertigen sucht,\n\nwer eine von ihm angebotene Leistung, die für die Allgemeinheit bestimmt ist, einer Person oder einer Gruppe von Personen wegen ihrer Rasse, Ethnie, Religion oder sexuellen Orientierung verweigert,\n\nwird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lit