satz1litfz: "",     absatz1litf: "",     absatz1litfbisz: "",     absatz1litfbis: "",     marginaleabsatz1litg: "",     absatz1litgz: "",     absatz1litg: "",     marginaleabsatz1lith: "",     absatz1lithz: "",     absatz1lith: "",     marginaleabsatz1liti: "",     absatz1litiz: "",     absatz1liti: "",     marginaleabsatz1litj: "",     absatz1litjz: "",     absatz1litj: "",     absatz1litkz: "",     absatz1litk: "",     absatz1litlz: "",     absatz1litl: "",     absatz1litmz: "",     absatz1litm: "",     absatz1litnz: "",     absatz1litn: "",     absatz1litoz: "",     absatz1lito: "",     absatz1bisz: "",     absatz1bis: "",     absatz1bislitaz: "",     absatz1bislita: "",     absatz1bislitbz: "",     absatz1bislitb: "",     absatz1bislitcz: "",     absatz1bislitc: "",     absatz2z: "2",     absatz2: "    Hat der Täter in diesem selbstverschuldeten Zustand ein mit Freiheitsstrafe als einzige Strafe bedrohtes Verbrechen begangen, so ist die Strafe Freiheitsstrafe bis zu drei Jahren oder Geldstrafe.",     absatz2litaz: "",     absatz2lita: "",     absatz2litabisz: "",     absatz2litabis: "",     absatz2litbz: "",     absatz2litb: "",     absatz2litbbisz: "",     absatz2litbbis: "",     absatz2litcz: "",     absatz2litc: "",     absatz2litdz: "",     absatz2litd: "",     absatz2litez: "",     absatz2lite: "",     absatz2litfz: "",     absatz2litf: "",     absatz2litgz: "",     absatz2litg: "",     absatz2lithz: "",     absatz2lith: "",     absatz2litiz: "",     absatz2liti: "",     absatz2litjz: "",     absatz2litj: "",     absatz2litkz: "",     absatz2litk: "",     absatz2litlz: "",     absatz2litl: "",     absatz2litmz: "",     absatz2litm: "",     absatz2litnz: "",     absatz2litn: "",     absatz2litoz: "",     absatz2lito: "",     absatz2litpz: "",     absatz2litp: "",     absatz2litqz: "",     absatz2litq: "",     absatz2litrz: "",     absatz2litr: "",     absatz2litsz: "",     absatz2lits: "",     absatz2littz: "",     absatz2litt: "",     absatz2lituz: "",     absatz2litu: "",     absatz2litvz: "",     absatz2litv: "",     absatz2bisz: "",     absatz2bis: "",     absatz2bislitaz: "",     absatz2bislita: "",     absatz2bislitbz: "",     absatz2bislitb: "",     absatz2bislitcz: "",     absatz2bislitc: "",     absatz2bislitdz: "",     absatz2bislitd: "",     absatz2bislitez: "",     absatz2bislite: "",     absatz2terz: "",     absatz2ter: "",     absatz2quaterz: "",     absatz2quater: "",     absatz2quaterlitaz: "",     absatz2quaterlita: "",     absatz2quaterlitbz: "",     absatz2quaterlitb: "",     absatz2quaterlitcz: "",     absatz2quaterlitc: "",     absatz2quinquiesz: "",     absatz2quinquies: "",     absatz2sexiesz: "",     absatz2sexies: "",     absatz2septiesz: "",     absatz2septies: "",     absatz3z: "",     absatz3: "",     absatz3litaz: "",     absatz3lita: "",     absatz3litbz: "",     absatz3litb: "",     absatz3litcz: "",     absatz3litc: "",     absatz3litdz: "",     absatz3litd: "",     absatz3litdziffer1z: "",     absatz3litdziffer1: "",     absatz3litdziffer2z: "",     absatz3litdziffer2: "",     absatz3bisz: "",     absatz3bis: "",     absatz4z: "",     absatz4: "",     absatz4litaz: "",     absatz4lita: "",     absatz4litaziffer1z: "",     absatz4litaziffer1: "",     absatz4litaziffer2z: "",     absatz4litaziffer2: "",     absatz4litbz: "",     absatz4litb: "",     absatz4litbziffer1z: "",     absatz4litbziffer1: "",     absatz4litbziffer2z: "",     absatz4litbziffer2: "",     absatz4litcz: "",     absatz4litc: "",     absatz4litdz: "",     absatz4litd: "",     absatz4bisz: "",     absatz4bis: "",     absatz4bislitaz: "",     absatz4bislita: "",     absatz4bislitbz: "",     absatz4bislitb: "",     absatz4terz: "",     absatz4ter: "",     absatz4quaterz: "",     absatz4quater: "",     absatz4quinquiesz: "",     absatz4quinquies: "",     absatz5z: "",     absatz5: "",     absatz5litaz: "",     absatz5lita: "",     absatz5litaziffer1z: "",     absatz5litaziffer1: "",     absatz5litaziffer2z: "",     absatz5