    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "Zwölfter Titelbis: Völkermord und Verbrechen gegen die Menschlichkeit",     kapitel: "",     abschnitt: "",     artikel: "Art. 264",     marginale1: "Völkermord",     marginale2: "",     absatz0: "Mit lebenslänglicher Freiheitsstrafe oder mit Freiheitsstrafe nicht unter zehn Jahren wird bestraft, wer, in der Absicht, eine durch ihre Staatsangehörigkeit, Rasse, Religion oder ethnische, soziale oder politische Zugehörigkeit gekennzeichnete Gruppe als solche ganz oder teilweise zu vernichten:",     absatz0litaz: "a.",     absatz0lita: "Mitglieder dieser Gruppe tötet oder auf schwerwiegende Weise in ihrer körperlichen oder geistigen Unversehrtheit schädigt;",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "b.",     absatz0litb: "Mitglieder der Gruppe Lebensbedingungen unterwirft, die geeignet sind, die Gruppe ganz oder teilweise zu vernichten;",     absatz0litcz: "c.",     absatz0litc: "Massnahmen anordnet oder trifft, die auf die Geburtenverhinderung innerhalb der Gruppe gerichtet sind;",     absatz0litdz: "d.",     absatz0litd: "Kinder der Gruppe gewaltsam in eine andere Gruppe überführt oder überführen lässt.",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "",     absatz1litb: "",     absatz1litbziffer1z: "",     absatz1