tbz: "",     absatz4bislitb: "",     absatz4terz: "",     absatz4ter: "",     absatz4quaterz: "",     absatz4quater: "",     absatz4quinquiesz: "",     absatz4quinquies: "",     absatz5z: "",     absatz5: "",     absatz5litaz: "",     absatz5lita: "",     absatz5litaziffer1z: "",     absatz5litaziffer1: "",     absatz5litaziffer2z: "",     absatz5litaziffer2: "",     absatz5litaziffer3z: "",     absatz5litaziffer3: "",     absatz5litaziffer4z: "",     absatz5litaziffer4: "",     absatz5litaziffer5z: "",     absatz5litaziffer5: "",     absatz5litaziffer6z: "",     absatz5litaziffer6: "",     absatz5litaziffer7z: "",     absatz5litaziffer7: "",     absatz5litaziffer8z: "",     absatz5litaziffer8: "",     absatz5litaziffer9z: "",     absatz5litaziffer9: "",     absatz5litbz: "",     absatz5litb: "",     absatz5litcz: "",     absatz5litc: "",     absatz5litdz: "",     absatz5litd: "",     absatz5bisz: "",     absatz5bis: "",     absatz6z: "",     absatz6: "",     absatz6litaz: "",     absatz6lita: "",     absatz6litbz: "",     absatz6litb: "",     absatz6litcz: "",     absatz6litc: "",     absatz6litdz: "",     absatz6litd: "",     absatz6litez: "",     absatz6lite: "",     absatz6litfz: "",     absatz6litf: "",     absatz6litgz: "",     absatz6litg: "",     absatz6lithz: "",     absatz6lith: "",     absatz6bisz: "",     absatz6bis: "",     absatz7z: "",     absatz7: "",     absatz7bisz: "",     absatz7bis: "",     absatz8z: "",     absatz8: "",     absatz9z: "",     absatz9: ""),
    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 264a",     marginale1: "Verbrechen gegen die Menschlichkeit",     marginale2: "",     absatz0: "",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "1",     absatz1: "    Mit Freiheitsstrafe nicht unter fünf Jahren wird bestraft, wer im Rahmen eines ausgedehnten oder systematischen Angriffs gegen die Zivilbevölkerung:",     marginaleabsatz1lita: "a. Vorsätzliche Tötung",     absatz1litaz: "a.",     absatz1lita: "einen Menschen vorsätzlich tötet;",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "b. Ausrottung",     absatz1litbz: "b.",     absatz1litb: "viele Menschen vorsätzlich tötet oder der Bevölkerung in der Absicht, sie ganz oder teilweise zu vernichten, Lebensbedingungen auferlegt, die geeignet sind, deren Vernichtung herbeizuführen;",     absatz1litbziffer1z: "",     absatz1litbziffer1: "",     absatz1litbziffer2z: "",     absatz1litbziffer2: "",     absatz1litbziffer3z: "",     absatz1litbziffer3: "",     marginaleabsatz1litc: "c. Versklavung",     absatz1litcz: "c.",     absatz1litc: "sich ein Eigentumsrecht über einen Menschen anmasst und über ihn verfügt, namentlich in Form von Menschenhandel, sexueller Ausbeutung oder Zwangsarbeit;",     absatz1litcbisz: "",     absatz1litcbis: "",     marginaleabsatz1litd: "d. Freiheitsberaubung",     absatz1litdz: "d.",     absatz1litd: "einem Menschen unter Verstoss gegen die Grundregeln des Völkerrechts in schwerwiegender Weise die Freiheit entzieht;",     marginaleabsatz1lite: "e. Verschwindenlassen von Personen",     absatz1litez: "e.",     absatz1lite: "in der Absicht, eine Person für längere Zeit dem Schutz des Gesetzes zu entziehen:",     absatz1liteziffer1z: "1.",     absatz1liteziffer1: "im Auftrag oder mit Billigung eines Staates oder einer politischen Organisation der Person die Freiheit entzieht, wobei in der Folge die Auskunft über ihr Schicksal oder ihren Verbleib verweigert wird, oder",     absatz1liteziffer2z: "2.",     absatz1liteziffer2: "im Auftrag eines Staates oder einer politischen Organisation oder entgegen einer Rechtspflicht die Auskunft über das Schicksal oder den Verbleib dieser Person verweigert;",     marginaleabsatz1litf: "f. Folter",     absatz1litfz: "f.",     absatz1litf: "einem unter seinem Gewahrsam oder seiner Kontrolle stehenden Menschen grosse Leiden oder eine schwere Schädigung des Körpers oder der physischen oder psychischen Gesundheit zufügt;",     absatz1litfbisz: "",     absatz1litfbis: "",     marginaleabsatz1litg: "g. Verletzung der sexuellen Selbstbestimmung",     absatz1litgz: "g.",     absatz1litg: "eine Person weiblichen Geschlechts vergewaltigt oder, nachdem sie gegen ihren Willen geschwängert wurde, gefangen hält in der Absicht, die ethnische Zusammensetzung einer Bevölkerung zu beeinflussen, eine Person zur Duldung einer sexuellen Handlung von vergleichbarer Schwere oder zur Prostitution nötigt oder sie zwangsweise sterilisiert;",     marginaleabsatz1lith: "h. Vertreibung oder zwangsweise Überführung",     absatz1lithz: "h.",     absatz1lith: "Menschen aus dem Gebiet, in dem sie sich rechtmässig aufhalten, vertreibt oder zwangsweise an einen andern Ort überführt;",     marginaleabsatz1liti: "i. Verfolgung und Apartheid",     absatz1litiz: "i.",     absatz1liti: "einer Gruppe von Menschen aus politischen, rassischen, ethnischen, religiösen, sozialen oder anderen völkerrechtswidrigen Gründen, im Zusammenhang mit einer Tat nach dem zwölften Titelbis oder dem zwölften Titelter oder zwecks systematischer Unterdrückung oder Beherrschung einer rassischen Gruppe, in schwerwiegender Weise Grundrechte vorenthält oder entzieht;",     marginaleabsatz1litj: "j. Andere unmenschliche Handlungen",     absatz1litjz: "j.",     absatz1litj: "eine andere Handlung von vergleichbarer Schwere wie die in diesem Absatz genannten Verbrechen verübt und dadurch einem Menschen grosse Leiden oder eine schwere Schädigung des Körpers oder der physischen oder psychischen Gesundheit zufügt.",     absatz1litkz: "",     absatz1litk: "",     absatz1litlz: "",     absatz1litl: "",     absatz1litmz: "",     absatz1litm: "",     absatz1litnz: "",     absatz1litn: "",     absatz1litoz: "",     absatz1lito: "",     absatz1bisz: "",     absatz1bis: "",     absatz1bislitaz: "",     absatz1bislita: "",     absatz1bislitbz: "",     absatz1bislitb: "",     absatz1bislitcz: "",     absatz1bislitc: "",     absatz2z: "2",     absatz2: "    In besonders schweren Fällen, namentlich wenn die Tat viele Menschen betrifft oder der Täter grausam handelt, kann auf lebenslängliche Freiheitsstrafe erkannt werden.",     absatz2litaz: "",     absatz2lita: "",     absatz2litabisz: "",     absatz2litabis: "",     absatz2litbz: "",     absatz2litb: "",     absatz2litbbisz: "",     absatz2litbbis: "",     absatz2litcz: "",     absatz2litc: "",     absatz2litdz: "",     absatz2litd: "",     absatz2litez: "",     absatz2lite: "",     absatz2litfz: "",     absatz2litf: "",     absatz2litgz: "",     absatz2litg: "",     absatz2lithz: "",     absatz2lith: "",     absatz2litiz: "",     absatz2liti: "",     absatz2litjz: "",     absatz2litj: "",     absatz2litkz: "",     absatz2litk: "",     absatz2litlz: "",     absatz2litl