    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 264c",     marginale1: "2. Schwere Verletzungen der Genfer Konventionen",     marginale2: "",     absatz0: "",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "1",     absatz1: "    Mit Freiheitsstrafe nicht unter fünf Jahren wird bestraft, wer im Zusammenhang mit einem internationalen bewaffneten Konflikt eine schwere Verletzung der Genfer Konventionen vom 12. August 1949 durch eine der folgenden Handlungen gegen die nach diesen Konventionen geschützten Personen oder Güter begeht:",     marginaleabsatz1lita: "",     absatz1litaz: "a.",     absatz1lita: "vorsätzliche Tötung;",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "b.",     absatz1litb: "Geiselnahme;",     absatz1litbziffer1z: "",     absatz1litbziffer1: "",     absatz1litbziffer2z: "",     absatz1litbziffer2: "",     absatz1litbziffer3z: "",     absatz1litbziffer3: "",     marginaleabsatz1litc: "",     absatz1litcz: "c.",     absatz1litc: "Verursachung grosser Leiden oder schwere Schädigung des Körpers oder der physischen oder psychischen Gesundheit, namentlich durch Folter, unmenschliche Behandlung oder biologische Versuche;",     absatz1litcbis