    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 271",     marginale1: "Verbotene Handlungen für einen fremden Staat",     marginale2: "",     absatz0: "1. Wer auf schweizerischem Gebiet ohne Bewilligung für einen fremden Staat Handlungen vornimmt, die einer Behörde oder einem Beamten zukommen,\n\nwer solche Handlungen für eine ausländische Partei oder eine andere Organisation des Auslandes vornimmt,\n\nwer solchen Handlungen Vorschub leistet,\n\nwird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe, in schweren Fällen mit Freiheitsstrafe nicht unter einem Jahr bestraft.\n\n2. Wer jemanden durch Gewalt, List oder Drohung ins Ausland entführt, um ihn einer fremden Behörde, Partei oder anderen Organisation zu überliefern oder einer Gefahr für Leib und Leben auszusetzen, wird mit Freiheitsstrafe nicht unter einem Jahr bestraft.\n\n3. Wer eine solche Entführung vorbereitet, wird mit Freiheitsstrafe oder Geldstrafe bestraft.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "",     absatz1litb: "",     absatz1litbz