    GesetzestextSTGBBT2(buch: "",     teil: "",     titel: "",     kapitel: "",     abschnitt: "",     artikel: "Art. 272",     marginale1: "2. Verbotener Nachrichtendienst.",     marginale2: "Politischer Nachrichtendienst",     absatz0: "1. Wer im Interesse eines fremden Staates oder einer ausländischen Partei oder einer andern Organisation des Auslandes zum Nachteil der Schweiz oder ihrer Angehörigen, Einwohner oder Organisationen politischen Nachrichtendienst betreibt oder einen solchen Dienst einrichtet,\n\nwer für solche Dienste anwirbt oder ihnen Vorschub leistet,\n\nwird mit Freiheitsstrafe bis zu drei Jahren oder Geldstrafe bestraft.\n\n2. In schweren Fällen ist die Strafe Freiheitsstrafe nicht unter einem Jahr. Als schwerer Fall gilt es insbesondere, wenn der Täter zu Handlungen aufreizt oder falsche Berichte erstattet, die geeignet sind, die innere oder äussere Sicherheit der Eidgenossenschaft zu gefährden.",     absatz0litaz: "",     absatz0lita: "",     absatz0litaziffer1z: "",     absatz0litaziffer1: "",     absatz0litaziffer2z: "",     absatz0litaziffer2: "",     absatz0litaziffer3z: "",     absatz0litaziffer3: "",     absatz0litaziffer4z: "",     absatz0litaziffer4: "",     absatz0litbz: "",     absatz0litb: "",     absatz0litcz: "",     absatz0litc: "",     absatz0litdz: "",     absatz0litd: "",     absatz0litez: "",     absatz0lite: "",     absatz0litfz: "",     absatz0litf: "",     absatz0litgz: "",     absatz0litg: "",     absatz0lithz: "",     absatz0lith: "",     absatz1z: "",     absatz1: "",     marginaleabsatz1lita: "",     absatz1litaz: "",     absatz1lita: "",     absatz1litaziffer1z: "",     absatz1litaziffer1: "",     absatz1litaziffer2z: "",     absatz1litaziffer2: "",     absatz1litaziffer3z: "",     absatz1litaziffer3: "",     absatz1litabisz: "",     absatz1litabis: "",     marginaleabsatz1litb: "",     absatz1litbz: "",     absatz1litb: "",     absatz1litbziffer1z: "",     absatz1litbziffer1: "",     absatz1litbziffer2z: "",     absa